@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Card a owl:Class .
atm:ATM a owl:Class .
atm:WrongPasswordEntry a owl:Class .

atm:hasCard a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Card .

atm:hasWrongPasswordEntry a owl:ObjectProperty ;
    rdfs:domain atm:Card ;
    rdfs:range atm:WrongPasswordEntry .

atm:entryCount a owl:DatatypeProperty ;
    rdfs:domain atm:WrongPasswordEntry ;
    rdfs:range xsd:integer .

atm:KeptCard a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:hasWrongPasswordEntry ;
                          owl:someValuesFrom [ a owl:Restriction ;
                                               owl:onProperty atm:entryCount ;
                                               owl:minQualifiedCardinality 3 ;
                                               owl:onDataRange xsd:integer
                                             ]
                        ] .

atm:ATM a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:hasCard ;
                      owl:someValuesFrom atm:KeptCard
                    ] .
